INSERT INTO `_static_pages` VALUES ('1', 'certificates', 'Сертификаты на переключатели', 'Сертификаты на переключатели, технические условия на переключатели, ТУ на переключатели', 'Сертификаты и технические условия на переключатели  производства ЧП Харьковреле из комплектующих Sez Krompachy', '<h1>Сертификаты на кулачковые переключатели</h1>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h2>Сертификат соответствия</h2>\r\n</td>\r\n<td>\r\n<h2>Технические условия</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"pages/static_pages/certificates/sertificat.jpg\" alt=\"Сертификат качества на кулачковые переключатили\" height=\"600\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/certificates/technicalterms.gif\" alt=\"Технические условия на кулачковые переключатили\" height=\"600px\" /></td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"pages/static_pages/certificates/tu1.jpg\" alt=\"Сертификат качества на кулачковые переключатили\" height=\"600\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/certificates/tu2.jpg\" alt=\"Технические условия на кулачковые переключатили\" height=\"600px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>');
INSERT INTO `_static_pages` VALUES ('2', 'description_switchers', 'Описание кулачковых переключателей', 'Кулачковые переключатели', 'Описание кулачковых переключателей производства ЧП Харьковреле из комплектующих Sez Krompachy', '<h1>Описание кулачковых переключателей</h1>\r\n<h2>Общие сведения</h2>\r\n<p>Ряд кулачковых переключателей серии S10,16,25,32,63,100,160J новое поколение переключателей в электрическом ряду от 10 до 160А. Переключатели по габаритным размерам разделены на три группы. – 1-й размер – S10J, S16J, S25J – размер переключающего механизма 43х43х(13,5n)*мм – 2-й размер – S32J, S63 – размер переключающего механизма 66х66х(18,5n)*мм – 3-й размер – S100J, S160J – размер переключающего механизма 77х77х(21n)*мм *– размер в скобке – обозначает высоту одной галеты, n – количество галет. Электрические выводы переключателя выполнены под винтовой зажим с прижимной пластиной. Все зажимы и соединения в переключателе защищены от прямого соприкосновения обслуживающего персонала с токоведущими элементами. Степень защиты переключателей IP21 по ГОСТ 14254 или IP54 для исполнения G (уплотнение по оси ручки). Переключатель по способу крепления подразделяется на исполнения: – крепление на переднюю (лицевую) панель</p>\r\n<table class=\"schema_title\" style=\"background-attachment: scroll; background-repeat: repeat; background-image: none; background-position: 0% 0%; background-size: auto; background-origin: padding-box; background-clip: border-box; background-color: #ffffff; width: auto;\" border=\"1\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Тип обозначения</td>\r\n<td>Вид изготовления переключателя</td>\r\n</tr>\r\n<tr>\r\n<td>S…J</td>\r\n<td>С ручкой (без лицевой панели)</td>\r\n</tr>\r\n<tr>\r\n<td>S…JG</td>\r\n<td>С ручкой и уплотнением по оси ручки до IP65</td>\r\n</tr>\r\n<tr>\r\n<td>S…JD</td>\r\n<td>С ручкой и лицевой панелью</td>\r\n</tr>\r\n<tr>\r\n<td>S…JU</td>\r\n<td>С ручкой и возможностью применения навесных замков</td>\r\n</tr>\r\n<tr>\r\n<td>S…JV</td>\r\n<td>С одним или двумя возвратными положениями (только S10,16,25J)</td>\r\n</tr>\r\n<tr>\r\n<td>S…JK</td>\r\n<td>Быстро монтируемый (Ø22мм) с управлением ключом (только S10,16,25J)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>– на заднюю (монтажную) панель и на DIN-рейку</p>\r\n<table class=\"schema_title\" style=\"background-attachment: scroll; background-repeat: repeat; background-image: none; background-position: 0% 0%; background-size: auto; background-origin: padding-box; background-clip: border-box; background-color: #ffffff; width: auto;\" border=\"1\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Тип обозначения</td>\r\n<td>Вид изготовления переключателя</td>\r\n</tr>\r\n<tr>\r\n<td>S…JО</td>\r\n<td>Заднее крепление переключателя (на монтажну панель)</td>\r\n</tr>\r\n<tr>\r\n<td>S…JLD</td>\r\n<td>С креплением на DIN-рейку 35х7,5 с лицевой панелью</td>\r\n</tr>\r\n<tr>\r\n<td>S…JB</td>\r\n<td>Заднее крепление переключателя – с ручкой на двери</td>\r\n</tr>\r\n<tr>\r\n<td>S…JBD</td>\r\n<td>Заднее крепление переключателя – с ручкой и лицевой панелью на двери</td>\r\n</tr>\r\n<tr>\r\n<td>S…JBU</td>\r\n<td>Заднее крепление переключателя – с замыкающейся ручкой на двери</td>\r\n</tr>\r\n<tr>\r\n<td>S…JP</td>\r\n<td>В герметичном корпусе из пластика без лицевой панели (IP 65)</td>\r\n</tr>\r\n<tr>\r\n<td>S…JPD</td>\r\n<td>В герметичном корпусе из пластика с лицевой панелью (IP 65)</td>\r\n</tr>\r\n<tr>\r\n<td>S…JPU</td>\r\n<td>В герметичном корпусе из пластика с замыкающейся ручкой (IP 65)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Переключатель по углу поворота в фиксированные положения подразделяется на четыре исполнения: а) 1 - 30°; б) 6 - 60°; в) 8 - 45°; г) 4 - 90°. Рабочее положение в пространстве – любое. Максимальное количество положений переключения при угле 30° - 12. Максимальное количество галет – 12 (контактов – 24). Диапазон рабочих температур от минус 40°С до плюс 60°С. Механическая износостойкость не менее 1000000 переключений. Климатическое исполнение \"0\", категория размещения 4 по ГОСТ 15150 и ГОСТ 15543.1.</p>\r\n<h3>Структура условного обозначения</h3>\r\n<div class=\"discrip\"><img class=\"left\" src=\"pages/static_pages/description_switches/3.gif\" alt=\"\" /></div>\r\n<p>Пример записи переключателя с номинальным током 10А, с самовозвратом (V), с лицевой панелью (D), с резиновым уплотнением для IP54 (G), со схемой (2203) без перемычек (Х)<!-- em--><!-- strong-->, с первоначальным положением ручки (А–на 12 часов), с углом переключения 60º (6) при заказе и в документации другой продукции: <strong>Переключатель S10JVDG 2203Х A6 ТУ У 31.2-267672-001:2005</strong>.<!-- strong--></p>\r\n<h3>Основные технические данные</h3>\r\n<div class=\"discrip\"><img class=\"left\" src=\"pages/static_pages/description_switches/4.gif\" alt=\"\" width=\"750px\" /></div>\r\n<h3>Внешний вид, габаритные и установочные размеры</h3>\r\n<p> </p>\r\n<div class=\"discrip\"><img class=\"left\" src=\"pages/static_pages/description_switches/5.gif\" alt=\"\" /></div>\r\n<h2>Переключатель с передним креплением (на переднюю панель)</h2>\r\n<h3>Переключатель с ручкой без лицевой панели S…J . . .</h3>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/6.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/7.jpg\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\"><img class=\"left\" src=\"pages/static_pages/description_switches/8.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<center>n – количество галет (от 1 до 12)</center>\r\n<h3>Переключатель с ручкой и лицевой панелью D             S…JD . . .</h3>\r\n<p>(переключатели с лицевой панелью могут комплектоваться информационной табличкой)</p>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/9.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/10.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/11.jpg\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\"><img class=\"left\" src=\"pages/static_pages/description_switches/12.jpg\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Переключатель с ручкой и лицевой панелью D с самовозвратом в соседнее положение S 10, 16, 25 JVD . . .</h3>\r\n<p>-в заказе необходимо указать (для переключателея с более чем двумя положениями) желаемое поворотное и возвратное положение, например для переключателя 0-1-2, при желаемом возврате из положения 2 в положение 1, необходимо указать V2-V1.</p>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/13.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/14.gif\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Переключатель с лицевой панелью D              S…JDG . . .</h3>\r\n<p>(имеет уплотнение по оси ручки до IP54)</p>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td> </td>\r\n<td>крепление 2-мя саморезами</td>\r\n<td>крепление винт - гайка</td>\r\n</tr>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/15.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/16.gif\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/17.gif\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Переключатель с лицевой панелью U              S…JU . . .</h3>\r\n<p>(имеет возможность фиксации положения ручки навесным замком)</p>\r\n<p> </p>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/17.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/18.jpg\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\"><img class=\"left\" src=\"pages/static_pages/description_switches/19.gif\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Переключатель с задним креплением (на монтажную панель)</h2>\r\n<h3>С блокируемой ручкой на двери</h3>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"3\">\r\n<h3>S…JBU . . .</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/20.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/21.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/22.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\">\r\n<h3>S…JBD . . .</h3>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/23.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/24.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td> </td>\r\n<td> </td>\r\n<td>крепление ручки на дверь</td>\r\n<td>заднее крепление переключателя</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\"><img class=\"left\" src=\"pages/static_pages/description_switches/25.gif\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/25a.gif\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/25b.gif\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Т* – расстояние от монтажной панели до плоскости двери (определяет заказчик)</p>\r\n<h3>Переключатель с креплением на DIN-рейку (35х7,5)мм              S…JLD . . .</h3>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/26.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/27.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/28.jpg\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\"><img class=\"left\" src=\"pages/static_pages/description_switches/29.gif\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Переключатель с креплением на монтажную панель              S…JO . . .</h3>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/jo.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td ><img class=\"left\" src=\"pages/static_pages/description_switches/jo_fix.jpg\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Переключатель в изолированной коробке (степень защиты IP54)</h2>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/30.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/31.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/32.jpg\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>Переключатель с ручкой типа рукоятка</h2>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>без лицевой панели</td>\r\n<td>с лицевой панелью</td>\r\n<td> </td>\r\n</tr>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/33.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/34.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/35.gif\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Переключатель с управлением ключом и быстрым монтажом в отверстие Ø22мм.</h3>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/36.jpg\" alt=\"\" height=\"200px\" /></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/description_switches/37.gif\" alt=\"\" height=\"200px\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>');
INSERT INTO `_static_pages` VALUES ('3', 'switchers', 'Кулачковые переключатели и выключатели', ' кулачковые переключатели, продажа переключателей', 'Кулачковые переключатели производства ЧП Харьковреле из комплектующих Sez Krompachy, купить переключатель, цена на переключатели, доставка по Украине', '<h1 align=\"center\">Кулачковые переключатели и выключатели</h1>\r\n<p>ЧП &laquo;ХАРЬКОВРЕЛЕ&raquo; на протяжении 12 лет занимается производством кулачковых выключателей и переключателей серии S10J, S16J, S25J, S32J, S63, S100J, S160J из комплектующих поставляемых, одним из лидеров мировых производителей электротехнической продукции, АО &laquo;SEZ&raquo; Krompachy.</p>\r\n<p>Довольно оригинальная и несложная конструкция переключателей и применяемые материалы позволяет повысить надежность изделий и увеличить механическую износостойкость до 1 млн. переключений.</p>\r\n<p>Кулачковые переключатели нашего предприятия имеют технические условия ТУ У 31.2-32676972-001:2005 зарегистрированные в Госстандарте Украины. Наши переключатели обладают сертификатами системы управления качеством подтверждающими, что предприятие производит электротехнические изделия высокого качества. Сертификаты можно посмотреть на нашем сайте в разделе&nbsp;<span style=\"color: #993300;\"><strong><span style=\"font-size: medium;\"><a href=\"/certificates\"><span style=\"color: #993300;\">Сертификаты</span></a></span></strong></span>.</p>\r\n<p>Наши выключатели и переключатели имеют большую гамму конструктивных исполнений по способу крепления в электротехническом оборудовании. С внешним видом конструктивных исполнений, техническим описанием и характеристиками наших выключателей и переключателей можно ознакомиться в разделе&nbsp;<strong><span style=\"color: #993300; font-size: medium;\"><a href=\"/description_switchers\"><span style=\"color: #993300;\">Описание</span></a></span></strong>.</p>\r\n<p>Схемы (диаграммы замыканий) наших выключателей и переключателей позволяют максимально решить Вашу потребность в коммутации электрических цепей в электротехническом оборудовании.</p>\r\n<p>В числе стандартных схем (диаграмм замыкания):</p>\r\n<p>&ndash; выключатели и ступенчатые переключатели с положением &laquo;0&raquo; и без положения &laquo;0&raquo;;</p>\r\n<p>&ndash; ступенчатые переключатели без разъединения при переключении на соседнее положение с первоначальным положением &laquo;0&raquo;;</p>\r\n<p>&ndash; ступенчатые переключатели с перекрытием контактов без положения &laquo;0&raquo;;</p>\r\n<p>&ndash; ступенчатые регуляторы мощности;</p>\r\n<p>&ndash; выключатели и переключатели для измерительных приборов &ndash; амперметры, вольтметры, ваттметры;</p>\r\n<p>&ndash; выключатели и переключатели для однофазных двигателей;</p>\r\n<p>&ndash; выключатели и переключатели для трехфазных асинхронных электродвигателей (реверсивный, звезда-треугольник);</p>\r\n<p>&ndash; переключатель полей (Dahlander).</p>\r\n<p>Помимо стандартных схем (диаграмм замыканий) в нашем арсенале имеется порядка одной тысячи нестандартных схем созданных по Вашим заявкам. Все схемы (диаграммы) можно посмотреть на нашем сайте в разделе <span style=\"font-size: medium;\"><strong><span style=\"color: #993300;\"><a href=\"scheme/\"><span style=\"color: #993300;\">Схемы</span></a></span></strong></span> или воспользоваться автоматической системой <strong><span style=\"color: #993300; font-size: medium;\"><a href=\"pages/search_scheme/search_scheme.php\"><span style=\"color: #993300;\">Поиск</span></a></span></strong>. Если в нашем перечне не оказалось нужной схемы (диаграммы), Вы имеете возможность самим создать нужную вам схему (диаграмму замыканий) на нашем сайте пройдя по ссылке <strong><span style=\"color: #993300; font-size: medium;\"><a href=\"/pages/order_switcher/constr_switcher1.php\"><span style=\"color: #993300;\">Конструктор</span></a></span></strong>.</p>\r\n<p>В разделе <strong><span style=\"color: #993300; font-size: medium;\"><a href=\"/switcher/passport.php\"><span style=\"color: #993300;\">Паспорт</span></a></span></strong> Вы имеете возможность посмотреть и распечатать паспорт на выбранный Вами переключатель.</p>\r\n<p>Список всех наименований переключателей, производимых ЧП &laquo;ХАРЬКОВРЕЛЕ&raquo;, можно просмотреть в разделе <strong><span style=\"color: #993300; font-size: medium;\"><a href=\"/switcher/list.php\"><span style=\"color: #993300;\">Перечень</span></a></span></strong>.</p>\r\n<p>&nbsp; Чтобы купить переключатели можно сделать on-line заказ, перейдя по ссылке <strong><span style=\"color: #993300; font-size: medium;\"><a href=\"pages/order_switcher/order_switcher.php\"><span style=\"color: #993300;\">Заказать переключатель</span></a></span></strong>, или заказать переключатели &nbsp;по телефону&nbsp;<span>(057) 759 18 54. Цену на переключатели тоже можно узнать по телефону&nbsp;(057) 759 18 54.</span></p>\r\n<p>&nbsp; На странице <strong><span style=\"color: #993300; font-size: large;\"><a href=\"faqs.php\"><span style=\"color: #993300;\">Часто задаваемые вопросы по переключателям</span></a></span></strong> можно просмотреть ответы на вопросы, которые задают нам наши клиенты, а также задать свой вопрос.</p>\r\n<p>Производственная мощность ЧП &laquo;ХАРЬКОВРЕЛЕ&raquo; позволяет обеспечить потребность всех предприятий Украины качественной электротехнической продукцией. Наши регистрационные документы можно посмотреть и распечатать в разделе <strong><span style=\"color: #993300; font-size: medium;\"><a href=\"/reg_doc\"><span style=\"color: #993300;\">Регистр. докум</span></a></span></strong>.&nbsp;</p>');
INSERT INTO `_static_pages` VALUES ('4', 'metal_constr', 'Металлоконструкции (шкафы электротехнические)', 'Шкафы электротехнические', 'Описание электротехнических шкафов, купить электротехнические шкафы, цена на электротехнические шкафы, доставка по Украине', '<h1><span>Металлоконструкции (шкафы электротехнические)</span></h1>\r\n<p>В настоящее время выпускаются металлоконструкции четырех видов: <strong><a title=\"шкафы каркасные\" href=\"cabinets_frame\">шкафы каркасные</a>, <a title=\"шкафы цельносварные\" href=\"cabinets_allwelded\">&nbsp;шкафы цельносварные</a>, &nbsp;<a title=\"навесные ящики\" href=\"boxes\">&nbsp;навесные ящики</a>&nbsp;</strong>и<strong> <a title=\"пульты управления\" href=\"remotes\">пульты управления</a></strong><!-- strong-->.</p>\r\n<p>Электрические шкафы и пульты управления предназначены для установки на промышленных, жилых, бытовых и общественных объектах.</p>\r\n<p>Шкафы изготавливаются как с односторонним, так и с двухсторонним обслуживанием, одно и двухстворчатые, в навесном и напольном исполнении, каркасные и бескаркасные. Возможна модульная сборка как напольных, так и навесных шкафов.</p>\r\n<p>Все шкафы и пульты комплектуются монтажными панелями и по желанию заказчика могут дополнительно комплектоваться перфорированными пластинами и профилями и/или/ другим дополнительным оборудованием.Также могут быть пробиты круглые и прямоугольные отверстия любых размеров на любой плоскости металлоконструкции.</p>\r\n<p>Оболочки шкафов и пультов изготавливаются из стали толщиной 1,5-2 мм., монтажные панели - 2,5 мм. Каркас со стороны двери имеет отбортовку в виде желоба, который препятствует попаданию во внутренний объем грязи и воды.</p>\r\n<p>Шкафы и пульты имеют степень защиты IP21 и IP54, что позволяет эксплуатировать их в различных климатических условиях, а также в запыленных и влажных помещениях.</p>\r\n<p>IP54 - достигается применением уплотнительной резины.</p>\r\n<p>Для запора применены стандартные замки с вставкой с двойной прорезью или треугольной. Для шкафов высотой более 1м и двухстворчатых &ndash; применяются замки с вертикальными тягами. Шкафы напольного исполнения и пульты по желанию заказчика могут комплектоваться цоколем высотой 100, 150 или 200мм.</p>\r\n<p>Кабельный ввод выполнен в виде люка с крышкой и по желанию заказчика может быть выполнен как на дне, так и на крыше шкафа.</p>\r\n<p>Шкафы и пульты окрашены порошковой термореактивной полимерной краской RAL 7032 или RAL 7035.</p>\r\n<div class=\"discrip\"><img class=\"left\" src=\"pages/static_pages/metal_constr/1.jpg\" alt=\"\" /></div>\r\n<p>По желанию заказчика шкафы и пульты могут быть, укомплектованы электрооборудованием ведущих европейских и отечественных производителей и смонтированы на самом высоком профессиональном уровне.</p>');
INSERT INTO `_static_pages` VALUES ('5', 'cabinets_frame', 'Шкафы электротехнические каркасные', 'Шкафы электротехнические каркасные', 'Описание каркасных электротехнических шкафов. Цена на каркасные электротехнические шкафы. Купить каркасные электротехнические шкафы. Доставка по Украине.', '<h1><span>Шкафы электротехнические каркасные</span></h1>\r\n<center>\r\n<h4>Металлоконструкции каркасные напольного исполнения серии МК</h4>\r\n</center>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/1.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2>Шкаф одностворчатый</h2>\r\n</td>\r\n<td>\r\n<h2>Таблица типовых размеров шкафов</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/2.gif\" alt=\"\" width=\"100%\" /></td>\r\n<td rowspan=\"3\" width=\"50%\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/3.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2>Шкаф двухстворчатый</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/cabinets_frame/4.jpg\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td wiidth=\"50%\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/5.jpg\" alt=\"\" height=\"70%\" /></td>\r\n<td rowsspan=\"3\" wiidth=\"50%\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/6.jpg\" alt=\"\" height=\"70%\" /></td>\r\n</tr>\r\n<tr>\r\n<td rowsspan=\"3\" wiidth=\"33%\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/7.jpg\" alt=\"\" height=\"100%\" /></td>\r\n<td rowsspan=\"3\" wiidth=\"33%\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/8.jpg\" alt=\"\" height=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td rowsspan=\"3\" wiidth=\"33%\"><img class=\"left\" src=\"pages/static_pages/cabinets_frame/9.jpg\" alt=\"\" height=\"100%\" /></td>\r\n\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>   Чтобы купить каркасные электротехнические шкафы сделайте заказ по телефону (057) 759 18 54. Цену на каркасные электротехнические шкафы можно узнать по телефону (057) 759 18 54. Доставка по Украине.</p>');
