INSERT INTO `_static_pages` VALUES ('7', 'boxes', 'Ящики электрические (шкафы настенные навесные)', 'Ящик электрическиекий, навесной ящик, навесной шкаф', 'Описание навесных ящиков', '<h1>Ящики электрические (шкафы настенные навесные)</h1>\r\n<center>\r\n<h4>Металлоконструкции навесного исполнения серии МК</h4>\r\n</center>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><img class=\"left\" src=\"pages/static_pages/boxes/1.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2>Ящик одностворчатый</h2>\r\n</td>\r\n<td>\r\n<h2>Таблица типовых размеров ящиков</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/boxes/2.gif\" alt=\"\" width=\"100%\" /></td>\r\n<td rowspan=\"3\" width=\"50%\"><img class=\"left\" src=\"pages/static_pages/boxes/3.gif\" alt=\"\" width=\"100%\" /> <img class=\"left\" src=\"pages/static_pages/boxes/5.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2>Ящик двухстворчатый</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img class=\"left\" src=\"pages/static_pages/boxes/4.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td ><img class=\"left\" src=\"pages/static_pages/boxes/box.jpg\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>  Чтобы купить ящики электрические (шкафы настенные навесные) сделайте заказ по телефону (057) 759 18 54. Цену на ящики электрические (шкафы настенные навесные) можно узнать по телефону (057) 759 18 54. Доставка по Украине.</p>');
INSERT INTO `_static_pages` VALUES ('8', 'remotes', 'Пульты металлические', 'Пульты металлические', 'Описание металлоконструкций пультов управления', '<script type=\"text/javascript\">\r\n  function openImageWindow(src) {\r\n    var image = new Image();\r\n    image.src = src;\r\n    var width = image.width;\r\n    var height = image.height;    window.open(src,\"Image\",\"width=\"+width+\",height=\"+height+\",directories=no\");\r\n  }\r\n</script>\r\n<h1>Пульты</h1>\r\n<center>\r\n<h4>Пульты управления</h4>\r\n</center>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><img class=\"left\" src=\"pages/static_pages/remotes/1.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2>Пульт с наклонной консолью</h2>\r\n</td>\r\n<td>\r\n<h2>Пульт с прямой консолью</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/2.gif\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\'/></td>\r\n<td ><img class=\"left\" src=\"pages/static_pages/remotes/4.gif\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\' /></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2>Таблица типовых размеров пультов с консолью</h2>\r\n</td>\r\n\r\n</tr>\r\n<tr>\r\n\r\n<td rrowspan=\"2\" width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/3.gif\" alt=\"\" width=\"100%\" />\r\n<p>* размеры могут быть изменены по желанию заказчика</p>\r\n</td>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/7.jpg\" title=\"Нажмите для увеличения изображения\" alt=\"\" width=\"80%\" onclick = \'openImageWindow(this.src);\'/></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<h2>Пульт с передним обслуживанием</h2>\r\n</td>\r\n<td>\r\n<h2>Пульт с задним обслуживанием</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/remote_front.jpg\" title=\"Нажмите для увеличения изображения\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\'/></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/remotes/remote_back.jpg\" title=\"Нажмите для увеличения изображения\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\' /></td>\r\n</tr>\r\n<tr>\r\n<tr>\r\n<td>\r\n<h2>Пульт с двухстворчатой дверью</h2>\r\n</td>\r\n<td>\r\n<h2>Пульт с двухстворчатой дверью</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/remore_double_doors.jpg\" title=\"Нажмите для увеличения изображения\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\'/></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/remotes/remore_double_doors_opened.jpg\" title=\"Нажмите для увеличения изображения\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\' /></td>\r\n</tr>\r\n<tr>\r\n<tr>\r\n<td>\r\n<h2>Пульт без консоли</h2>\r\n</td>\r\n<td>\r\n<h2>Таблица типовых размеров пультов без консоли</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/5.gif\" alt=\"\" width=\"100%\" /></td>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/6.gif\" alt=\"\" width=\"100%\" /></td>\r\n</tr>\r\n<tr>\r\n<td width=\"50%\"><img class=\"left\" src=\"pages/static_pages/remotes/remote_console_without-closed.jpg\" title=\"Нажмите для увеличения изображения\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\'/></td>\r\n<td><img class=\"left\" src=\"pages/static_pages/remotes/remote_console_without-opened.jpg\" title=\"Нажмите для увеличения изображения\" alt=\"\" height=\"500\" onclick = \'openImageWindow(this.src);\' /></td>\r\n</tr>\r\n\r\n</tbody>\r\n</table>\r\n<p>Примечания:</p>\r\n<p>1. Пульт длиной 1000 мм и более имеют двухстворчатую дверь на тумбе.</p>\r\n<p>2. Тумба пульта может быть с передним или с задним обслуживанием.</p>\r\n<p>3. По желанию заказчика пульты могут комплектоваться цоколем.</p>\r\n<p>   Чтобы купить пульты металлические сделайте заказ по телефону (057) 759 18 54. Цену на пульты металлические можно узнать по телефону (057) 759 18 54. Доставка по Украине.</p>');
INSERT INTO `_static_pages` VALUES ('9', 'bcm', 'Блоки управления двигателями', 'Блок управления двигателями', 'Блок управления двигателями', '<h1>Блок управления двигателями</h1>\r\n <center><h4>Страница в разработке</h4></center>  ');
INSERT INTO `_static_pages` VALUES ('10', 'products', 'Продукция', 'Продукция', 'Продукция, производимая ЧП Харьковреле', '<h1>Продукция</h1>\r\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"10\" cellpadding=\"4\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h2><a title=\"Переключатели\" href=\"switchers\">Переключатели</a></h2>\r\n</td>\r\n<td>\r\n<h2><a href=\"metal_constr\">Металлоконструкции</a></h2>\r\n</td>\r\n<td>\r\n<h2><a href=\"bcm\">Блоки управления двигателями</a></h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><a title=\"Переключатели\" href=\"switchers\"> <img id=\"img1\" src=\"pages/static_pages/products/switcher.jpg\" alt=\"Переключатели\" height=\"300\" /></a></td>\r\n<td><a title=\"Металлоконструкции\" href=\"metal_constr\"> <img id=\"img2\" src=\"pages/static_pages/products/mc.jpg\" alt=\"Металлоконструкции\" height=\"300\" /></a></td>\r\n<td><a title=\"Блоки управления двигателями\" href=\"bcm\"> <img id=\"img3\" src=\"pages/static_pages/products/bcm.jpg\" alt=\"Блоки управления двигателями\" height=\"300\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>');
INSERT INTO `_static_pages` VALUES ('11', 'services', 'Услуги', 'Монтаж электротехнических шкафов, монтаж электротехнического оборудования, разработка электротехнического оборудования', 'Описание услуг ЧП Харьковреле (изготовление электротехнических шкафов, производство электротехнического оборудования, разработка электрических схем)', '<h1>Услуги</h1>\r\n<p>1. Проектирование, изготовление, монтаж и пусконаладочные работы электротехнического оборудования с рабочим напряжением до 1000 В.</p>\r\n<p>2. Проектирование и изготовление:</p>\r\n<pre style=\"font-size: 110%;\">	- низковольтных распределительных устройств;\r\n	- распределительных силовых шкафов;\r\n	- силовых ящиков разрыва типа ЯР, ЯРП;\r\n	- ящиков управления электродвигателями Я5000;\r\n	- устройств автоматического переключения на резерв АВР;\r\n	- устройств вводно-распределительных и электрощитового оборудования, как по схемам заказчика, так и по схемам, разработанным нашими специалистами.</pre>\r\n<p>3. Выполнение работ по комплексной модернизации автоматических линий управления технологическими процессами.</p>\r\n<p>4. Перевод существующей документации в электронную версию.</p>\r\n<p>5. Модернизацию станков с ЧПУ.</p>\r\n<p>6. Изготовление многопозиционных кулачковых переключателей на базе комплектующих фирмы &rdquo;SEZ Krompachy&rdquo; (Словакия), предназначенных для коммутации электрических цепей с током до 160 А и напряжением до 500 В с различными схемами переключения. Продукция сертифицирована.</p>\r\n<p>7. Изготовление оболочек электротехнических ящиков, шкафов и пультов управления со степенью защиты IP 41, IP 54. Качественная порошковая покраска позволяет использовать эти изделия в различных условиях окружающей среды. Они имеют надежную универсальную конструкцию, проверены практикой и надежно работают у наших партнеров. Широчайшая гамма типоразмеров, использование принципа модульности и возможность использования индивидуальных проектов, позволяет нашим заказчикам решать задачи любой сложности.</p>');
INSERT INTO `_static_pages` VALUES ('12', 'order', 'Заказать', 'купить переключатель, купить металлоконструкцию, купить блок управления двигателями', 'купить переключатель, купить металлоконструкцию, купить блок управления двигателями. Цена на переключатели, цена на металлоконструкции. Доставка по Украине.', '<h1>Заказать</h1>\r\n<table style=\"width: 100%;\" border=\"0\" cellspacing=\"10\" cellpadding=\"4\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<h2><a href=\"pages/order_switcher/order_switcher.php\">Переключатель</a></h2>\r\n</td>\r\n<td>\r\n<h2><a href=\"pages/order_mc/order_mc.php\">Металлоконструкцию</a></h2>\r\n</td>\r\n<td>\r\n<h2><a href=\"pages/order_bcm/order_bcm.php\">Блок управления двигателем</a></h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><a title=\"Заказать переключатель\" href=\"pages/order_switcher/order_switcher.php\"> <img id=\"img1\" src=\"pages/static_pages/order/switcher.jpg\" alt=\"Заказать переключатель\" height=\"300\" /></a></td>\r\n<td><a title=\"Заказать металлоконструкцию\" href=\"pages/order_mc/order_mc.php\"> <img id=\"img2\" src=\"pages/static_pages/order/mc.jpg\" alt=\"Заказать металлоконструкцию\" height=\"300\" /></a></td>\r\n<td><a title=\"Заказать блок управления двигателем\" href=\"pages/order_bcm/order_bcm.php\"> <img id=\"img3\" src=\"pages/static_pages/order/bcm.jpg\" alt=\"Заказать блок управления двигателем\" height=\"300\" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp; Чтобы купить переключатель можно сделать on-line заказ переключателей перейдите по ссылке <strong><span style=\"color: #993300; font-size: medium;\"><a href=\"pages/order_switcher/order_switcher.php\"><span style=\"color: #993300;\">Заказать переключатель</span></a></span></strong>. Цену на переключатели можно узнать по телефону&nbsp;<span>(057) 759 18 54. Чтобы купить металлоконструкцию и узнать цену на металлоконструкцию можно можно позвонить по телефону&nbsp;<span>(057) 759 18 54.</span></span></p>');
INSERT INTO `_static_pages` VALUES ('13', 'payment', 'Оплата и доставка', 'Оплата заказа, доставка заказа, сроки выполнения заказа', 'Оплата заказа,  доставка заказа, сроки выполнения заказа.', '<h1 style=\"text-align: center;\"><span style=\"color: #000000;\">Оплата и доставка</span></h1>\r\n<center>\r\n<h4>Обработка заявки</h4>\r\n</center>\r\n<p style=\"text-align: left;\">Для оформления заказа Вам необходимо получить счет-фактуру.</p>\r\n<p style=\"text-align: left;\">Для этого необходимо на наше предприятие по факсу или по электронной почте направить:</p>\r\n<p style=\"text-align: left;\">Для юридических лиц:</p>\r\n<p style=\"text-align: left;\">&nbsp;&ndash; копию свидетельства госрегистрации;</p>\r\n<p style=\"text-align: left;\">&ndash; копию свидетельства плательщика НДС;</p>\r\n<p style=\"text-align: left;\">&ndash; номер телефона для налоговых документов;</p>\r\n<p style=\"text-align: left;\">&ndash; для обратной связи указать контактное лицо и его номер телефона.</p>\r\n<p style=\"text-align: left;\">Для физических лиц:</p>\r\n<p style=\"text-align: left;\">&ndash; ксерокопию паспорта с пропиской;</p>\r\n<p style=\"text-align: left;\">&ndash; контактный телефон.</p>\r\n<p style=\"text-align: left;\">&nbsp; &nbsp; &nbsp;Заказ выполняется после 100% предоплаты. Срок выполнения заказа указывается в счет-фактуре и зависит от объема заказа. Для получение продукции необходимо направить нам доверенность. Отправка продукции и документов заказчику осуществляется:</p>\r\n<p style=\"text-align: left;\">&ndash; в г. Харькове &ndash; самовывоз,</p>\r\n<p style=\"text-align: left;\">&ndash; для иногородних - перевозчиком &laquo;Новая почта&raquo; или &laquo;Ночной экспресс&raquo;.</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>');
INSERT INTO `_static_pages` VALUES ('14', 'reg_doc', 'Регистрационные документы', '', 'Регистрационные документы ЧП харьковреле.', '<h1>Регистрационные документы</h1>\r\n<table class=\"schema_title\" style=\"width: auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"10\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\">\r\n<h2>Свидетельство о государственной регистрации</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"pages/static_pages/reg_doc/evid_state_reg1n.jpg\" alt=\"Свидетельство о государственной регистрации\" height=\"600\" /></td>\r\n<td><img src=\"pages/static_pages/reg_doc/evid_state_reg2n.jpg\" alt=\"Свидетельство о государственной регистрации\" height=\"600\" /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">\r\n<h2>Свидетельство на право оплаты единого налога</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"pages/static_pages/reg_doc/evid_3_perc1n.jpg\" alt=\"Свидетельство на право оплаты единого налога\" height=\"400\" /></td>\r\n<td><img src=\"pages/static_pages/reg_doc/evid_3_perc2n.jpg\" alt=\"Свидетельство на право оплаты единого налога\" width=\"430\" height=\"400\" /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">\r\n<h2>Свидетельство регистрации платильщика НДС</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\"><img class=\"left\" src=\"pages/static_pages/reg_doc/evid_vatn.jpg\" alt=\"Свидетельство регистрации платильщика НДС\" height=\"600px\" /></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">\r\n<h2>Справка из единого государственного реестра</h2>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"pages/static_pages/reg_doc/part_state_registry1.jpg\" alt=\"Справка единого государственного реестра\" height=\"650\" /></td>\r\n<td><img src=\"pages/static_pages/reg_doc/part_state_registry2.jpg\" alt=\"Справка единого государственного реестра\" height=\"650\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>');
INSERT INTO `_static_pages` VALUES ('15', 'contacts', 'Контакты', 'Харьковреле, телефон ЧП Харьковреле, адрес ЧП Харьковреле', 'Контактная информация ЧП Харьковреле, место расположения ЧП Харьковреле, форма обратной связи.', '<h1>Контакты</h1>\r\n<p><span style=\"color: #000000;\">Время работы</span>: <strong>пн - пт: с 8:30 до 17:00</strong><!-- strong--></p>\r\n<p>Обеденный перерыв: <strong>с 13:00 до 13:30</strong><!-- strong--></p>\r\n<p>&nbsp;</p>\r\n<p>Телефон/факс прямой: <strong>(057) 759 18 54</strong><!-- strong--></p>\r\n<p>Телефон/факс через секретаря: <strong>(057) 719 88 89,</strong><!-- strong--></p>\r\n<p><strong>(057) 719 88 90, (057) 719 88 51, (057) 758 70 65</strong><!-- strong--></p>\r\n<p>&nbsp;</p>\r\n<p>Электронная почта:<strong> valeriy@rele.kharkov.com,</strong></p>\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;rele_switch@mail.ru</strong><!-- strong--></p>\r\n<p>&nbsp;</p>\r\n<p>Мы находимся по адресу: <strong>г. Харьков, ул. Достоевского, 13</strong></p>');
INSERT INTO `_static_pages` VALUES ('16', 'faq', 'Часто задаваемые вопросы', 'Харьковреле', 'Харьковреле', '<h1>Часто задаваемые вопросы</h1>\r\n<p style=\"text-align: left;\"><strong>&nbsp;</strong></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p>&nbsp;</p>');
INSERT INTO `_static_pages` VALUES ('17', 'main', 'Главная страница', 'Харьковреле', 'Проектирование и монтаж электрооборудования, электромонтажные работы. Кулачковые переключатели, производство и продажа. У нас лучие цены и качество. (057) 759 18 54\"', '<h2>Наши переключатели перекрывают номенклатуру изделий LK-Spamel, 4G-Апатор, ПВ, ПГ, ПКУ, <span style=\"color: #000000;\">ПКП</span></h2>\r\n<p>Частное предприятие <strong>Харьковреле</strong><!-- strong--> является дочерним предприятием научно-технического центра&nbsp;<strong><a title=\"Харьковрелекомплект\" name=\"asd\" href=\"http://ntc.com.ua\">Харьковрелекомплект</a></strong><!-- strong--> и занимается производством <a style=\"font-size: 18px;\" title=\"Металлоконструкции\" href=\"http://khrl.com.ua/pages/metal_constr/metal_constr.php\"> электротехнических изделий.</a></p>\r\n<p>Вам выгодно сотрудничать с нами потому, что:</p>\r\n<p>- у нас высококвалифицированные специалисты, имеющие большой теоретический и практический опыт работ;</p>\r\n<p>- мы ведем индивидуальную работу с каждым клиентом для достижения оптимальных результатов;</p>\r\n<p>- мы используем современные высокотехнологичные комплектующие ведущих европейских производителей, основная масса которых постоянно поддерживается на складе;</p>\r\n<p>- мы выполняем все работы быстро, качественно и надежно;</p>\r\n<p>- мы проводим гибкую ценовую <span style=\"color: #000000;\">политику</span>.</p>\r\n<img style=\"border: 0;\" src=\"pages/static_pages/main/raes.png\" alt=\"РАЭС\" width=\"100%\" /> </br></br><img style=\"border: 0;\" src=\"pages/static_pages/main/asrk.jpg\" alt=\"АСРК\" width=\"100%\" />');
INSERT INTO `_static_pages` VALUES ('18', 'faqs', 'Часто задаваемые вопросы по переключателям', 'Часто задаваемые вопросы', 'Часто задаваемые вопросы', '<h1><span>Часто задаваемые вопросы по кулачковым переключателям</span></h1>\r\n<p><strong>Вопрос</strong>: Зависит ли цена на переключатели от количества?</p>\r\n<p><strong>Ответ</strong>: Да.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли купить переключатели без предоплаты?</p>\r\n<p><strong>Ответ</strong>: Нет.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Возможно ли изготовление переключателя на 13 и более положений ручки?</p>\r\n<p><strong>Ответ</strong>: Нет.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Предназначены ли ваши переключатели для коммутации постоянного тока?</p>\r\n<p><strong>Ответ</strong>: Да.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: можно ли у вас купить переключатель на din-рейку?</p>\r\n<p><strong>Ответ</strong>: да. В обозначении переключателя с креплением на дин-рейку должна быть буква L. Например,&nbsp;<a title=\"переключатель S25JLD1103A8\" href=\"http://khrl.com.ua/switcher/S25JLD1103A8\">S25JLD1103A8</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель с ключом?</p>\r\n<p><strong>Ответ</strong>: Да. В обозначении переключателя с ключом&nbsp;должна быть&nbsp;буква K. Например,&nbsp;<a title=\"переключатель S25JK1108A6\" href=\"http://khrl.com.ua/switcher/S25JK1108A6\">S25JK1108A6</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель без фиксации?</p>\r\n<p><strong>Ответ</strong>: Да.&nbsp;В обозначении переключателя без фиксации&nbsp;должна быть&nbsp;буква V. Например,&nbsp;<a title=\"переключатель S25JVD2202C8\" href=\"http://khrl.com.ua/switcher/S25JVD2202C8\">S25JVD2202C8</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Где можно просмотреть каталог переключателей, которые вы производите?</p>\r\n<p><strong>Ответ</strong>: Список производимых переключателей можно просмотреть на странице&nbsp;</p>\r\n<p><a href=\"switcher/list.php\">&nbsp;</a><a href=\"switcher/list.php\">Перечень переключателей</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель в корпусе?</p>\r\n<p><strong>Ответ</strong>: Да.&nbsp;В обозначении переключателя в корпусе&nbsp;быть&nbsp;буква P. Например, &nbsp;<a title=\"переключатель S25JPD1102A4\" href=\"http://khrl.com.ua/switcher/S25JPD1102A4\">S25JPD1102A4</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Где можно просмотреть диаграмму переключателя?</p>\r\n<p><strong>Ответ</strong>: Диаграмму замыканий контактов переключателя можно просмотреть на странице&nbsp;<a href=\"scheme/\">Схемы кулачковых переключателей</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Имеется ли на ваши переключатели ГОСТ?</p>\r\n<p><strong>Ответ</strong>: Нет. На наши переключатели имеются только&nbsp;<a href=\"certificates\">Технические условия</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;Имеется ли на ваши переключатели сертификат качесива?</p>\r\n<p><strong>Ответ</strong>: Да. Просмотреть его можно на странице&nbsp;<a href=\"certificates\">Сертификаты на кулачковые переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить ступенчатый переключатель?&nbsp;</p>\r\n<p><strong>Ответ</strong>: Да. Наше предприятия производит большой ассортимент ступенчатых переключателей. Схемы и диаграммы замыканий на ступенчатые переключатели можно просмотреть на странице&nbsp;<a href=\"scheme/\">Схемы кулачковых переключателей</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель с ip21?</p>\r\n<p><strong>Ответ</strong>: Да. Все наши переключатели имеют степень защиты ip21.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель с ip44?</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Ответ</strong>: Нет. Наши переключатели имеют степени защиты ip21 и ip54.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель с ip55?</p>\r\n<p><strong>Ответ</strong>: Нет. Максимальная степень защиты у наших переключателей ip54.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Производители ли вы ремонт переключателей?</p>\r\n<p><strong>Ответ</strong>: Да. Мы производим гарантийный и послегарантийный ремонт переключателей, но только своего производства.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Где можно просмотреть электросхему переключателя?</p>\r\n<p><strong>Ответ</strong>: Электросхему переключателя можно просмотреть на странице&nbsp;<a href=\"scheme/\">Схемы кулачковых переключателей</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить силовой переключатель?</p>\r\n<p><strong>Ответ</strong>: Да. Все наши переключатели предназначены для коммутации силовых цепей.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Как подсоединить переключатель? Где можно найти схему подключения переключателей</p>\r\n<p><strong>Ответ</strong>: Схемы подключения переключателей можно увидеть только для кулачковых переключателей с функциональными схемами:</p>\r\n<p>&nbsp;</p>\r\n<table class=\"schema\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\">\r\n<tbody>\r\n<tr><th class=\"block\">Назначение</th><th colspan=\"9\">Номер схемы</th></tr>\r\n<tr><th>Для переключения ТЭНов</th>\r\n<td><a title=\"схема 7192\" href=\"http://khrl.com.ua/scheme/7192\">7192</a></td>\r\n<td><a title=\"схема 7194\" href=\"http://khrl.com.ua/scheme/7194\">7194</a></td>\r\n<td><a title=\"схема 7201\" href=\"http://khrl.com.ua/scheme/7201\">7201</a></td>\r\n<td><a title=\"схема 7202\" href=\"http://khrl.com.ua/scheme/7202\">7202</a></td>\r\n<td><a title=\"схема 7204\" href=\"http://khrl.com.ua/scheme/7204\">7204</a></td>\r\n<td><a title=\"схема 7207\" href=\"http://khrl.com.ua/scheme/7207\">7207</a></td>\r\n<td><a title=\"схема 7211\" href=\"http://khrl.com.ua/scheme/7211\">7211</a></td>\r\n<td><a title=\"схема 7607\" href=\"http://khrl.com.ua/scheme/7607\">7607</a></td>\r\n</tr>\r\n<tr><th>Для амперметров</th>\r\n<td><a title=\"схема 8051\" href=\"http://khrl.com.ua/scheme/8051\">8051</a></td>\r\n<td><a title=\"схема 8052\" href=\"http://khrl.com.ua/scheme/8052\">8052</a></td>\r\n<td><a title=\"схема 8053\" href=\"http://khrl.com.ua/scheme/8053\">8053</a></td>\r\n<td><a title=\"схема 8101\" href=\"http://khrl.com.ua/scheme/8101\">8101</a></td>\r\n<td><a title=\"схема 8102\" href=\"http://khrl.com.ua/scheme/8102\">8102</a></td>\r\n<td><a title=\"схема 8151\" href=\"http://khrl.com.ua/scheme/8151\">8151</a></td>\r\n<td><a title=\"схема 8157\" href=\"http://khrl.com.ua/scheme/8157\">8157</a></td>\r\n<td><a title=\"схема 8164\" href=\"http://khrl.com.ua/scheme/8164\">8164</a></td>\r\n</tr>\r\n<tr><th>Для вольтметров</th>\r\n<td><a title=\"схема 8256\" href=\"http://khrl.com.ua/scheme/8256\">8256</a></td>\r\n<td><a title=\"схема 8351\" href=\"http://khrl.com.ua/scheme/8351\">8351</a></td>\r\n<td><a title=\"схема 8352\" href=\"http://khrl.com.ua/scheme/8352\">8352</a></td>\r\n<td><a title=\"схема 8357\" href=\"http://khrl.com.ua/scheme/8357\">8357</a></td>\r\n<td><a title=\"схема 8359\" href=\"http://khrl.com.ua/scheme/8359\">8359</a></td>\r\n<td><a title=\"схема 8453\" href=\"http://khrl.com.ua/scheme/8453\">8453</a></td>\r\n<td><a title=\"схема 8551\" href=\"http://khrl.com.ua/scheme/8551\">8551</a></td>\r\n<td><a title=\"схема 8752\" href=\"http://khrl.com.ua/scheme/8752\">8752</a></td>\r\n</tr>\r\n<tr><th>Для однофазных двигателей</th>\r\n<td><a title=\"схема 9051\" href=\"http://khrl.com.ua/scheme/9051\">9051</a></td>\r\n<td><a title=\"схема 9256\" href=\"http://khrl.com.ua/scheme/9256\">9256</a></td>\r\n<td><a title=\"схема 9455\" href=\"http://khrl.com.ua/scheme/9455\">9455</a></td>\r\n<td><a title=\"схема 94551\" href=\"http://khrl.com.ua/scheme/94551\">94551</a></td>\r\n<td><a title=\"схема 94552\" href=\"http://khrl.com.ua/scheme/94552\">94552</a></td>\r\n<td><a title=\"схема 9501\" href=\"http://khrl.com.ua/scheme/9501\">9501</a></td>\r\n<td><a title=\"схема 95012\" href=\"http://khrl.com.ua/scheme/95012\">95012</a></td>\r\n<td><a title=\"схема 91011\" href=\"http://khrl.com.ua/scheme/91011\">91011</a></td>\r\n<td><a title=\"схема 91012\" href=\"http://khrl.com.ua/scheme/91012\">91012</a></td>\r\n</tr>\r\n<tr><th rowspan=\"2\">Для трехфазных двигателей</th>\r\n<td><a title=\"схема 9151\" href=\"http://khrl.com.ua/scheme/9151\">9151</a></td>\r\n<td><a title=\"схема 93521\" href=\"http://khrl.com.ua/scheme/93521\">93521</a></td>\r\n<td><a title=\"схема 9551\" href=\"http://khrl.com.ua/scheme/9551\">9551</a></td>\r\n<td><a title=\"схема 9153\" href=\"http://khrl.com.ua/scheme/9153\">9153</a></td>\r\n<td><a title=\"схема 9354\" href=\"http://khrl.com.ua/scheme/9354\">9354</a></td>\r\n<td><a title=\"схема 9552\" href=\"http://khrl.com.ua/scheme/9552\">9552</a></td>\r\n<td><a title=\"схема 9154\" href=\"http://khrl.com.ua/scheme/9154\">9154</a></td>\r\n<td><a title=\"схема 9554\" href=\"http://khrl.com.ua/scheme/9554\">9554</a></td>\r\n<td><a title=\"схема 9555\" href=\"http://khrl.com.ua/scheme/9555\">9555</a></td>\r\n</tr>\r\n<tr>\r\n<td><a title=\"схема 9556\" href=\"http://khrl.com.ua/scheme/9556\">9556</a></td>\r\n<td><a title=\"схема 9567\" href=\"http://khrl.com.ua/scheme/9567\">9567</a></td>\r\n<td><a title=\"схема 9553\" href=\"http://khrl.com.ua/scheme/9553\">9553</a></td>\r\n<td><a title=\"схема 9557\" href=\"http://khrl.com.ua/scheme/9557\">9557</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Какие виды переключателей вы производите?&nbsp;Какие типы переключателей вы производите?&nbsp;</p>\r\n<p><strong>Ответ</strong>:</p>\r\n<p>Виды кулачковых переключателей:</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;J - С ручкой (без лицевой панели),</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JG - С ручкой и уплотнением по оси ручки до IP65,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JD - С ручкой и лицевой панелью,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JU - С ручкой и возможностью применения навесных замков,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JV - С одним или двумя возвратными положениями (только S10,16,25J),</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JK - Быстро монтируемый (&Oslash;22мм) с управлением ключом (только S10,16,25J),</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JО - Заднее крепление переключателя (на монтажную панель),</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JLD - С креплением на DIN-рейку 35х7,5 с лицевой панелью,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JB - Заднее крепление переключателя &ndash; с ручкой на двери,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JBD - Заднее крепление переключателя &ndash; с ручкой и лицевой панелью на двери,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JBU - Заднее крепление переключателя &ndash; с замыкающейся ручкой на двери,</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JP - В герметичном корпусе из пластика без лицевой панели (IP 54),</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JPD - В герметичном корпусе из пластика с лицевой панелью (IP 54),</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S&hellip;JPU - В герметичном корпусе из пластика с замыкающейся ручкой (IP 54).</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Ваш переключатель 220В выдержит?&nbsp;Ваш переключатель 380В выдержит?&nbsp;</p>\r\n<p><strong>Ответ</strong>: Да. Все наши переключатели выдерживают напряжение до 400В.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Где можно увидеть картинки переключателей?</p>\r\n<p><strong>Ответ</strong>: На странице&nbsp;<a href=\"description_switchers\">Описание кулачковых преключателей</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Как производится установка переключателей? Как поставить переключатель?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Переключатель устанавливается на лицевую панель или монтажную панель согласно типу переключателя. Крепежные размеры &nbsp;в разделе&nbsp;<a href=\"description_switchers\">Описание кулачковых преключателей</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Как осуществляется монтаж переключателей?&nbsp;</p>\r\n<p><strong>Ответ</strong>: Проводами, подключаемыми к винтовым клеммам переключателя.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли купить у вас многопозиционный переключатель?</p>\r\n<p><strong>Ответ</strong>:Да. Наши переключатели имеют от 2 до 12 позиций (положений ручки).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить&nbsp;переключатель 10А,&nbsp;переключатель&nbsp;16А,&nbsp;переключатель&nbsp;25А,&nbsp;переключатель 32А,&nbsp;переключатель&nbsp;&nbsp;63А,&nbsp;переключатель&nbsp;100А,&nbsp;переключатель 160А?</p>\r\n<p><strong>Ответ</strong>:Да.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;Можно ли у вас купить&nbsp;переключатель 40А?&nbsp;&nbsp;</p>\r\n<p><strong>Ответ</strong>: Нет. Рекомендуем переключатель 63А.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить&nbsp;переключатель ПК, переключатель ПК16, переключатель ПКП, переключатель ПП2, переключатель ПГК, переключатель ПГ2, переключатель ПВ, переключатель ПП, переключатель ТПКП, переключатель ПКУ3, переключатель ПМ5, переключатель КВМ, переключатель УП, &nbsp;&nbsp;&nbsp;переключатель&nbsp; APATOR, переключатель IEK, переключатель schneider, переключатель ABB, переключатель 4G10, переключатель schneider electric, переключатель lovato, переключатель TDM?</p>\r\n<p>&nbsp;<strong>Ответ</strong>: Мы производим аналоги этих переключателей из комплектующих&nbsp;SEZ Krompachy.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>: Чем отличается&nbsp;переключатель ПК, переключатель ПК16, переключатель ПКП, переключатель ПП2, переключатель ПГК, переключатель ПГ2, переключатель ПВ, переключатель ПП, переключатель ТПКП, переключатель ПКУ3, переключатель ПМ5, переключатель КВМ, переключатель УП, &nbsp;&nbsp;&nbsp;переключатель&nbsp; АПАТОР, переключатель ИЭК, переключатель ШНАЙДЕР, переключатель ABB, переключатель 4G10, переключатель шнайдер электрик, переключатель lovato, переключатель TDM&nbsp;&nbsp;от ваших переключателей?</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Ответ</strong>: Габаритными и установочными размерами.</p>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель вольтметров?</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Ответ</strong>: Да. Мы производим вольтметровые переключатели с номерами схем:&nbsp;</p>\r\n<table class=\"schema\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a title=\"схема 8256\" href=\"http://khrl.com.ua/scheme/8256\">8256</a></td>\r\n<td><a title=\"схема 8351\" href=\"http://khrl.com.ua/scheme/8351\">8351</a></td>\r\n<td><a title=\"схема 8352\" href=\"http://khrl.com.ua/scheme/8352\">8352</a></td>\r\n<td><a title=\"схема 8357\" href=\"http://khrl.com.ua/scheme/8357\">8357</a></td>\r\n<td><a title=\"схема 8359\" href=\"http://khrl.com.ua/scheme/8359\">8359</a></td>\r\n<td><a title=\"схема 8453\" href=\"http://khrl.com.ua/scheme/8453\">8453</a></td>\r\n<td><a title=\"схема 8551\" href=\"http://khrl.com.ua/scheme/8551\">8551</a></td>\r\n<td><a title=\"схема 8752\" href=\"http://khrl.com.ua/scheme/8752\">8752</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель амперметров?</p>\r\n<p><strong>Ответ</strong>: Да. Мы производим амперметровые переключатели с номерами схем:&nbsp;</p>\r\n<table class=\"schema\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a title=\"схема 8051\" href=\"http://khrl.com.ua/scheme/8051\">8051</a></td>\r\n<td><a title=\"схема 8052\" href=\"http://khrl.com.ua/scheme/8052\">8052</a></td>\r\n<td><a title=\"схема 8053\" href=\"http://khrl.com.ua/scheme/8053\">8053</a></td>\r\n<td><a title=\"схема 8101\" href=\"http://khrl.com.ua/scheme/8101\">8101</a></td>\r\n<td><a title=\"схема 8102\" href=\"http://khrl.com.ua/scheme/8102\">8102</a></td>\r\n<td><a title=\"схема 8151\" href=\"http://khrl.com.ua/scheme/8151\">8151</a></td>\r\n<td><a title=\"схема 8157\" href=\"http://khrl.com.ua/scheme/8157\">8157</a></td>\r\n<td><a title=\"схема 8164\" href=\"http://khrl.com.ua/scheme/8164\">8164</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Вопрос</strong>: Можно ли у вас купить переключатель нагревателей (ТЕНов)?</p>\r\n<p><strong>Ответ</strong>: Да. Мы производим &nbsp;переключатели нагревателей с номерами схем:&nbsp;</p>\r\n<table class=\"schema\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a title=\"схема 7192\" href=\"http://khrl.com.ua/scheme/7192\">7192</a></td>\r\n<td><a title=\"схема 7194\" href=\"http://khrl.com.ua/scheme/7194\">7194</a></td>\r\n<td><a title=\"схема 7201\" href=\"http://khrl.com.ua/scheme/7201\">7201</a></td>\r\n<td><a title=\"схема 7202\" href=\"http://khrl.com.ua/scheme/7202\">7202</a></td>\r\n<td><a title=\"схема 7204\" href=\"http://khrl.com.ua/scheme/7204\">7204</a></td>\r\n<td><a title=\"схема 7207\" href=\"http://khrl.com.ua/scheme/7207\">7207</a></td>\r\n<t