ить переключатель&nbsp;звезда-треугольник?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Мы производим &nbsp; переключатели звезда-треугольник&nbsp;с номерами схем:&nbsp;</p>\r\n<table class=\"schema\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a title=\"схема переключателя звезда-треугольник\" href=\"scheme/93521\">93521</a></td>\r\n<td><a title=\"схема переключателя звезда-треугольник\" href=\"scheme/9551\">9551</a></td>\r\n<td><a title=\"схема переключателя звезда-треугольник\" href=\"scheme/9153\">9153</a></td>\r\n<td><a title=\"схема переключателя звезда-треугольник\" href=\"scheme/9154\">9154</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить&nbsp;переключатель числа полюсов, переключатель полей,&nbsp;переключатель&nbsp;Dahlander?&nbsp;</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Мы производим &nbsp;переключатели&nbsp;числа полюсов,&nbsp;переключатели полей&nbsp;Dahlander&nbsp;с номерами схем:&nbsp;&nbsp;</p>\r\n<table class=\"schema\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a title=\"схема переключателя полей Dahlander\" href=\"scheme/9354\">9354</a></td>\r\n<td><a title=\"схема переключателя полей Dahlander\" href=\"scheme/9555\">9552</a></td>\r\n<td><a title=\"схема переключателя полей Dahlander\" href=\"scheme/9567\">9567</a></td>\r\n<td><a title=\"схема переключателя полей Dahlander\" href=\"scheme/9557\">9557</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить&nbsp;переключатель&nbsp;скоростей электродвигателя?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Мы производим &nbsp;переключатели&nbsp;скоростей электродвигателя с номерами схем:</p>\r\n<table class=\"schema\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a title=\"схема переключателя скоростей электродвигателя\" href=\"scheme/9554\">9554</a></td>\r\n<td><a title=\"схема переключателя скоростей электродвигателя\" href=\"scheme/9555\">9555</a></td>\r\n<td><a title=\"схема переключателя скоростей электродвигателя\" href=\"scheme/9556\">9556</a></td>\r\n<td><a title=\"схема переключателя скоростей электродвигателя\" href=\"scheme/9567\">9567</a></td>\r\n<td><a title=\"схема переключателя скоростей электродвигателя\" href=\"scheme/9557\">9557</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить&nbsp;двухполюсный переключатель?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да. &nbsp;Список схем для двухполюсных переключателей можно посмотреть на странице&nbsp;<a title=\"Двухполюсные переключатели\" href=\"schemes/c2\">Двухполюсные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить&nbsp;трехполюсный переключатель?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да. &nbsp;Список схем для трехполюсных переключателей можно посмотреть на странице&nbsp;<a title=\"Трехполюсные переключатели\" href=\"schemes/c3\">Трехполюсные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить&nbsp;четырехполюсный переключатель?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да. &nbsp;Список схем для четырехполюсных переключателей можно посмотреть на странице&nbsp;<a title=\"Четырехполюсные переключатели\" href=\"schemes/c4\">Четырехполюсные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить двухпозиционный переключатель (переключатель на 2 положения)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем двухпозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Двухпозиционные кулачковые переключатели\" href=\"schemes/p2\">Двухпозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить трехпозиционный переключатель (переключатель на 3 положения)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем трехпозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Трехпозиционные кулачковые переключатели. Схемы\" href=\"schemes/p3\">Трехпозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить четырехпозиционный переключатель (переключатель на 4 положения)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем четытрехпозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Четырехпозиционные кулачковые переключатели. Схемы\" href=\"schemes/p4\">Четырехпозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить пятипозиционный переключатель (переключатель на 5 положений)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем пятипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Шестипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p5\">Пятипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить шестипозиционный переключатель (переключатель на 6 положений)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем шестипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Шестипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p6\">Шестипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить семипозиционный переключатель (переключатель на 7 положений)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем семипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Семипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p7\">Семипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить восьмипозиционный переключатель (переключатель на 8 положений?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем восьмипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Восьмипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p8\">Восьмипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить девятипозиционный переключатель (переключатель на 9 положений)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем девятипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Девятипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p9\">Девятипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить десятипозиционный переключатель (переключатель на 10 положений)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем десятипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Десятипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p10\">Десятипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить одиннадцатипозиционный переключатель (переключатель на 11 положений)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем одиннадцатипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Одиннадцатипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p11\">Одиннадцатипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить двенадцатипозиционный переключатель (переключатель на 12 положений)?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем двенадцатипозиционных переключателей можно посмотреть на странице&nbsp;<a title=\"Двенадцатипозиционные кулачковые переключатели. Схемы\" href=\"schemes/p12\">Двенадцатипозиционные переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить&nbsp;on off on переключатель?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем on off on переключателtq&nbsp;можно посмотреть на странице&nbsp;<a title=\"On off on переключатели. Схемы\" href=\"schemes/mon-off-on-\">On off on переключатели</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить &nbsp;переключатель 1 2 3?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем &nbsp;переключателей 1 2 3&nbsp;можно посмотреть на странице&nbsp;<a title=\"Схемы кулачковых переключателей 1 2 3\" href=\"schemes/m1-2-3-\">Переключатели&nbsp;1 2 3</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить &nbsp;переключатель&nbsp;1 0 2?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем &nbsp;переключателей&nbsp;1 0 2 можно посмотреть на странице&nbsp;<a title=\"Схемы кулачковых переключателей 1 0 2\" href=\"schemes/m1-0-2-\">Переключатели&nbsp;1 0&nbsp;2</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить &nbsp;переключатель &nbsp;0 1 2?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем &nbsp;переключателей 0 1 2 можно посмотреть на странице&nbsp;<a title=\"Схемы кулачковых переключателей 0 1 2\" href=\"schemes/m0-1-2-\">Переключатели 0 1 2</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить &nbsp;переключатель 0 ?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем &nbsp;переключателей 0 1 можно посмотреть на странице&nbsp;<a title=\"Схемы кулачковых переключателей 0 1\" href=\"schemes/m0-1-\">Переключатели 0 1</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить &nbsp;переключатель&nbsp;1 2?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да.&nbsp;Список схем &nbsp;переключателей&nbsp;1 2 можно посмотреть на странице&nbsp;<a title=\"Схемы кулачковых переключателей 1 2\" href=\"schemes/m1-2-\">Переключатели&nbsp;1 2</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Вопрос</strong>:&nbsp;&nbsp;Можно ли у вас купить &nbsp;переключатель трехфазный?</p>\r\n<p><strong>Ответ</strong>:&nbsp;Да. Трехфазные переключатели с нулем имеют схему&nbsp;<a title=\"Трехфазный переключатель с нулем. Схема.\" href=\"scheme/2203\">2203</a>.&nbsp;Трехфазные переключатели без нуля имеют схему&nbsp;<a title=\"Схема трехфазного переключателя без нуля.\" href=\"scheme/2253\">2253</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>');
