
CREATE TABLE `_errors` (
  `name` varchar(255) NOT NULL,
  `value` text NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `_faq` (
  `id` int(7) NOT NULL AUTO_INCREMENT,
  `date` datetime NOT NULL,
  `subject` varchar(255) NOT NULL,
  `question` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

CREATE TABLE `_feedback` (
  `id` int(7) NOT NULL AUTO_INCREMENT,
  `date` datetime NOT NULL,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `subject` varchar(255) NOT NULL,
  `message` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

CREATE TABLE `_num_temp_sch` (
  `number` int(7) unsigned NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

CREATE TABLE `_order_switchers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `idorder` int(10) unsigned NOT NULL,
  `nameswitcher` varchar(255) NOT NULL,
  `quantity` int(10) NOT NULL,
  `current` int(5) NOT NULL,
  `handle` varchar(30) NOT NULL,
  `board` varchar(30) NOT NULL,
  `ip54` tinyint(3) unsigned NOT NULL,
  `fix` varchar(30) NOT NULL,
  `box` varchar(40) NOT NULL,
  `boxdirect` varchar(1) NOT NULL,
  `pg` varchar(10) NOT NULL,
  `length` int(5) unsigned NOT NULL,
  `qpos` tinyint(4) unsigned NOT NULL,
  `qcont` tinyint(4) unsigned NOT NULL,
  `closdiag` text NOT NULL,
  `qjump` tinyint(4) unsigned NOT NULL,
  `jump` text NOT NULL,
  `mark` text NOT NULL,
  `nscheme` varchar(255) NOT NULL,
  `moment` tinyint(4) unsigned NOT NULL,
  `momentfrom` varchar(30) NOT NULL,
  `angle` tinyint(4) unsigned NOT NULL,
  `initpos` varchar(4) NOT NULL,
  `addfield` text NOT NULL,
  `constructor` tinyint(3) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2213 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

CREATE TABLE `_orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `date` datetime NOT NULL,
  `nameorg` varchar(255) NOT NULL,
  `phone` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `contname` varchar(255) NOT NULL,
  `delivery` varchar(255) NOT NULL,
  `addfield` text NOT NULL,
  `errnameorg` text NOT NULL,
  `errphone` text NOT NULL,
  `erremail` text NOT NULL,
  `errcontname` text NOT NULL,
  `errdelivery` text NOT NULL,
  `sent` tinyint(3) unsigned NOT NULL,
  `new` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1395 DEFAULT CHARSET=utf8;

CREATE TABLE `_schemas` (
  `name` varchar(20) DEFAULT NULL,
  `qP` int(2) DEFAULT NULL,
  `qC` int(2) DEFAULT NULL,
  `closDiag` text CHARACTER SET utf8 COMMENT ' ',
  `att` varchar(10) CHARACTER SET utf8 DEFAULT NULL,
  `pM` tinyint(1) DEFAULT NULL,
  `mark` varchar(200) DEFAULT NULL,
  `qJ` tinyint(2) DEFAULT NULL,
  `jump` text CHARACTER SET utf8 COMMENT '__',
  `title` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `keywords` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `description` text CHARACTER SET utf8,
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=cp1251;

CREATE TABLE `_static_pages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `keywords` text NOT NULL,
  `description` text NOT NULL,
  `text` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

CREATE TABLE `_users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `login` varchar(255) NOT NULL,
  `password` varchar(32) NOT NULL,
  `status` varchar(30) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;
